import React from 'react';
import semen from '../assets/image/semen.jpg';

const Tour = (props) => {
    handleSlide = () => {
        const listImg = [{image1: props.image1},
        {image2: props.image2},
        {image3: props.image3}]
      } 

    return (
        <div class="container">
            <h5 className="center">Ethiopia Attractions, Historical Places, Parks, and Places to Visit</h5>
            <h6><strong>Simien Mountains National Park</strong></h6>
            <img src={semen} alt="semein mountains" />
            <p>Simien Mountains National Park - Massive erosion over the years on the Ethiopian plateau has created one of the most spectacular landscapes in the world, with jagged mountain peaks, deep valleys and sharp precipices dropping some 1,500 meters. The park is home to some extremely rare animals such as the Gelada baboon, the Simien fox and the Walia ibex, a goat found nowhere else in the world.
                In some places rain has eroded the more recent rocks, exposing the original rocks. Nowhere is this more prominent - and stunning - than in Ethiopia's northern Simien region. This was the epicentre of much volcanic activity about forty million years ago, and the resulting outpouring of a boiling mass of white-hot lava reached a thickness of some 3,000 metres (9,840 feet) in this area before it stopped. 
                Subsequent erosion of this volcanic core has produced the dramatic highs and lows of the Simicns: deep precipices and gorges, tall pinnacles of jagged rock, and weird, withered landscapes.</p>
                <a href="https://www.ethiovisit.com/simien-mountains-national-park/1/">See More..</a> 
        </div>
    );
}


export default Tour;
